> Political Bill Clinton to headline his first rally for wife's 2016 bid FILE - In this June 13, 2015 file photo, Democratic presidential candidate, former Secretary of State Hillary Rodham Clinton, and her husband, former President Bill Clinton, gesture to supporters on Roosevelt Island in New York. Former President Bill Clinton will headline his first rally for his wife’s presidential campaign on Saturday. He plans to address supporters of Hillary Rodham Clinton’s second White House bid before the Iowa Democratic Party dinner in Des Moines. The gathering is an important stop for presidential candidates seeking support in the early caucus state. (AP Photo/Frank Franklin II, File) 
